// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

import "../Structs.sol";

/**
 * @title the NFT contract for Bop
 * @author Vijay Dhanasekaran
 */
contract BopToken is ERC721, AccessControl {
    bytes32 public constant SONGS_MANAGER = keccak256("SONGS_MANAGER");
    bytes32 public constant SONG_CONTRACT = keccak256("SONG_CONTRACT");

    using Counters for Counters.Counter;
    Counters.Counter private _bopTokenId;

    mapping(uint256 => Bop) private _bopTokens;

    event Minted(address indexed account, uint256 indexed bopTokenId, uint256 timestamp);
    event Burned(address indexed account, uint256 indexed bopTokenId, uint256 timestamp);
    event UpdatedLevel(address indexed account, uint256 indexed bopTokenId, uint256 level, uint256 timestamp);
    event IncreasedIntensity(
        address indexed account,
        uint256 indexed bopTokenId,
        uint256 amount,
        uint256 timestamp
    );
    event BurnedBeats(address indexed account, uint256 indexed bopTokenId, uint256 amount, uint256 timestamp);

    /**
     * @param name name of the token
     * @param symbol symbol of the token
     * @param _songsManagerAddress the address of the SongsManager contract
     */
    constructor(
        string memory name,
        string memory symbol,
        address _songsManagerAddress
    ) ERC721(name, symbol) {
        _setRoleAdmin(SONG_CONTRACT, SONGS_MANAGER);
        _setupRole(SONGS_MANAGER, _songsManagerAddress);
    }

    /**
     * @notice Bop struct getter (only for owner)
     * @param bopTokenId The id of the media to retrieve
     */
    function getBop(uint256 bopTokenId) external view returns (Bop memory bop) {
        require(_exists(bopTokenId), "Nonexistent token");
        bop = _bopTokens[bopTokenId];
    }

    /**
     * @notice Mint Bop NFT Token
     * @param to The address of the account holder
     * @param songId Id of the song
     * @param parentId1 Id of the parent1
     * @param parentId2 Id of the parent2
     * @param genre Genre of the bop
     * @param beatsBurnt amount of beats burnt
     * @param traxStaked amount of trax staked
     * @param stablecoinStaked amount of stableCoinStaked
     */
    function mint(
        address to,
        uint256 songId,
        uint64 parentId1,
        uint64 parentId2,
        string memory genre,
        uint256 level,
        uint256 beatsBurnt,
        uint256 traxStaked,
        uint256 stablecoinStaked,
        bool priviVerified,
        address stablecoinToken
    ) public onlyRole(SONG_CONTRACT) {
        // generate new token id
        _bopTokenId.increment();
        uint256 newTokenId = _bopTokenId.current();

        uint64[] memory offsprings;

        Bop memory bop = Bop({
            bopId: newTokenId,
            songId: songId,
            level: level,
            intensity: stablecoinStaked,
            offsprings: offsprings,
            parentId1: parentId1,
            priviVerified: priviVerified,
            parentId2: parentId2,
            genre: genre,
            beatsBurnt: beatsBurnt,
            traxStaked: traxStaked,
            stablecoinStaked: stablecoinStaked,
            stablecoinToken: stablecoinToken
        });

        _mint(to, newTokenId);

        // store in storage
        _bopTokens[newTokenId] = bop;

        emit Minted(to, newTokenId, block.timestamp);
    }

    /**
     * @notice Burn Bop NFT Token
     * @param bopTokenId The NFT token Id
     */
    function burn(uint256 bopTokenId) public onlyRole(SONG_CONTRACT) {
        address owner = ownerOf(bopTokenId);

        _burn(bopTokenId);

        // remove token and  nullify
        delete _bopTokens[bopTokenId];

        emit Burned(owner, bopTokenId, block.timestamp);
    }

    /**
     * @notice Update Bop level (only by the owner)
     * @param bopTokenId The Bop NFT token Id
     * @param level The level to be updated
     */
    function updateLevel(uint256 bopTokenId, uint256 level) external onlyRole(SONG_CONTRACT) {
        require(_bopTokens[bopTokenId].bopId != 0, "Account does not have Bop");
        Bop storage bop = _bopTokens[bopTokenId];
        bop.level = level;

        emit UpdatedLevel(msg.sender, bopTokenId, level, block.timestamp);
    }

    /**
     * @notice Increase the intensity (only by the owner)
     * @param bopTokenId The Bop NFT token Id
     * @param intensity The intensity to be increased
     */
    function increaseIntensity(uint256 bopTokenId, uint256 intensity) external onlyRole(SONG_CONTRACT) {
        require(_bopTokens[bopTokenId].bopId != 0, "Account does not have Bop");
        Bop storage bop = _bopTokens[bopTokenId];
        bop.intensity += intensity;

        emit IncreasedIntensity(msg.sender, bop.bopId, intensity, block.timestamp);
    }

    /**
     * @notice Burn beats (only by the owner)
     * @param bopTokenId The Bop NFT token Id
     * @param beatsToBurn The amount of beats to be burnt
     */
    function burnBeats(uint256 bopTokenId, uint256 beatsToBurn) external onlyRole(SONG_CONTRACT) {
        require(_bopTokens[bopTokenId].bopId != 0, "Account does not have Bop");
        Bop storage bop = _bopTokens[bopTokenId];
        bop.beatsBurnt += beatsToBurn;

        emit BurnedBeats(msg.sender, bop.bopId, beatsToBurn, block.timestamp);
    }




    /**
     * @notice allows breeding a bop with beats
     * @param _bopId the token id
     * @param _amountOfBeats the token id
     */
    function breedBop(uint256 _bopId, uint256 _amountOfBeats) external onlyRole(SONG_CONTRACT) {}

    /**
     * @dev See {IERC165-supportsInterface}.
     */
    function supportsInterface(bytes4 interfaceId)
        public
        view
        override(ERC721, AccessControl)
        returns (bool)
    {
        return ERC721.supportsInterface(interfaceId) || AccessControl.supportsInterface(interfaceId);
    }
}

